window.bookSummaryJSON = "<p>I’ve spent years trying to be someone I’m not. Controlled and humanized.</p> <p>Still, the darkness lurks inside me, waiting for a chance to break free.</p> <p>As the headmaster at Corium University, I must maintain professionalism and keep myself in check. I manage to do that until the day I discover I have a daughter and all the carefully constructed walls I’ve built around myself start to crumble.</p> <p>I know I need an outlet, a way to shut it off, and then she lands in my lap.</p> <p>Delilah.</p> <p>I want to punish her, humiliate her, and hurt her in the best ways.</p> <p>It’s nothing but a cat and mouse game till I discover the secrets she’s hiding …</p>"; 
